function updateUserList(n){$.ajax({url:n,method:"post",dataType:"json",success:function(n){n!==""&&(userList=n)}})}function appendDropdown(n,t){n.length!==0&&($.each(n,function(n,t){let i=$("<li><\/li>").text(t);$("#dropdown").append(i)}),$("#dropdown").children().each(function(){$(this).click(()=>{$(t).val($(this).text()),$("#dropdown").children().remove()})}))}function keyUpDropdown(n){$("#dropdown").children().remove();let t=$(n.target),i=$(t).val();if(i!==""&&i!=="#"){$("#dropdown").detach().appendTo(t.parent());let r=[];$.each(userList,function(n,t){t.startsWith(i)&&r.push(t)});appendDropdown(r,t)}}function getHtmlFromStr(n){let t='<input class="tag-input" style="width: 100% " type = "text" autocomplete = "off" data - val="true" data - val - regex="Use only eng letter or numbers, length is up to 10" data - val - regex - pattern=" ^#[a - zA - Z0 - 9]{ 1, 10 }$" data - val - required="Tag is required" id = "Tags_'+n+'__TagName" name = "Tags['+n+'].TagName" value = "#" >';return(new DOMParser).parseFromString(t,"text/html").getElementsByTagName("input")[0]}let userList=[],timeInterval=2e4;const urlController="/Tag/GetAllTags/";updateUserList(urlController);setInterval(updateUserList,timeInterval,urlController);$(".tag-container").last().keyup(keyUpDropdown);$(document).mouseup(function(n){n.target.classList.contains("tag-input")?$("#dropdown").show():$("#dropdown").hide()});let i=1,btnTag=document.getElementById("btn-add-tag"),tableBody=document.getElementById("table-body");btnTag.onclick=function(){let t=document.createElement("tr"),n=document.createElement("td");n.classList.add("tag-container");n.appendChild(getHtmlFromStr(i));t.appendChild(n);tableBody.appendChild(t);$(".tag-container").last().keyup(keyUpDropdown);i++};